// FileList.js
import React from 'react';

const FileList = ({ files, onFileUpload, onFileDelete }) => {
    return (
        <div>
            {files.map((file, index) => (
                <div key={index}>
                    <span>{file.fileName}</span>
                    <button onClick={() => onFileDelete(file.fileId)}>Delete</button>
                </div>
            ))}
            {/* Upload functionality can be implemented here or in the parent component */}
        </div>
    );
};

export default FileList;
